import React from 'react';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
} from 'chart.js';
import { Line } from 'react-chartjs-2';
import 'chartjs-adapter-date-fns';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

const PM25Chart = ({ data }) => {
    if (!data || data.length === 0) return null;

    const chartData = {
        labels: data.map(d => new Date(d.created_at).toLocaleDateString()),
        datasets: [{
            label: 'PM2.5 Level',
            data: data.map(d => d.pm25),
            fill: false,
            borderColor: '#90c789',
            tension: 0.1
        }]
    };

    const options = {
        responsive: true,
        maintainAspectRatio: false,
        plugins: {
            legend: {
                position: 'top',
            },
            title: {
                display: false
            }
        }
    };

    return (
        <div className="chart-container">
            <Line data={chartData} options={options} />
        </div>
    );
};

export default PM25Chart;
